<#
    ================================================
      PHAT - Phishing Header Analyzer Tool (GUI)
    ================================================
    Version    : 0.2
    Author     : suuhm
    Created    : 08.05.2025
    Language   : PowerShell (.ps1)
    Requires   : Windows PowerShell, .NET Framework (System.Windows.Forms)

    Description:
    This tool provides a graphical user interface for analyzing
    email headers to identify key metadata such as SPF, DKIM,
    DMARC, routing paths (Received headers), and other forensic
    information relevant in phishing investigations.

    Features:
    - Paste or load email headers from .eml/.msg files
    - Extract and color-code SPF/DKIM/DMARC results
    - Display important header fields in a table
    - Export analysis results to TXT or CSV
    - Visual banner integration via base64 image

    Usage:
    Run this script in a PowerShell environment on Windows.
    It opens a GUI window where users can load, analyze, and export headers.

    ------------------------------------------------
    Â© 2025 suuhm. All rights reserved.
#>


Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing

$form = New-Object System.Windows.Forms.Form
$form.Text = "PHAT v.0.2 (Phishing Header Analyzer Tool) - (c) 2025 by suuhm"
$form.Size = New-Object System.Drawing.Size(950, 750)
$form.StartPosition = "CenterScreen"
$form.FormBorderStyle = "FixedDialog"
$form.MaximizeBox = $false


$base64Image = @"

"@

$bytes = [System.Convert]::FromBase64String($base64Image)
$ms = New-Object System.IO.MemoryStream(,$bytes)
$image = [System.Drawing.Image]::FromStream($ms)

$pictureBox = New-Object System.Windows.Forms.PictureBox
# Center -> 295,10 ((950-360)/2)
$pictureBox.Location = New-Object System.Drawing.Point(20, 10)
$pictureBox.Size = New-Object System.Drawing.Size(360, 180)
$pictureBox.SizeMode = "StretchImage"
$pictureBox.Image = $image
$form.Controls.Add($pictureBox)

$richTextBox = New-Object System.Windows.Forms.RichTextBox
$richTextBox.Size = New-Object System.Drawing.Size(900, 230)
$richTextBox.Location = New-Object System.Drawing.Point(20, 200)
$richTextBox.ScrollBars = "Vertical"
$form.Controls.Add($richTextBox)

$buttonCheck = New-Object System.Windows.Forms.Button
$buttonCheck.Text = "Check Header!"
$buttonCheck.Location = New-Object System.Drawing.Point(20, 440)
$buttonCheck.Size = New-Object System.Drawing.Size(100, 30)
$form.Controls.Add($buttonCheck)

$buttonUpload = New-Object System.Windows.Forms.Button
$buttonUpload.Text = "Load Files (.eml/.msg)"
$buttonUpload.Location = New-Object System.Drawing.Point(130, 440)
$buttonUpload.Size = New-Object System.Drawing.Size(160, 30)
$form.Controls.Add($buttonUpload)

$buttonExportTxt = New-Object System.Windows.Forms.Button
$buttonExportTxt.Text = "Export TXT"
$buttonExportTxt.Location = New-Object System.Drawing.Point(310, 440)
$buttonExportTxt.Size = New-Object System.Drawing.Size(100, 30)
$form.Controls.Add($buttonExportTxt)

$buttonExportCsv = New-Object System.Windows.Forms.Button
$buttonExportCsv.Text = "Export CSV"
$buttonExportCsv.Location = New-Object System.Drawing.Point(420, 440)
$buttonExportCsv.Size = New-Object System.Drawing.Size(100, 30)
$form.Controls.Add($buttonExportCsv)


$dataGrid = New-Object System.Windows.Forms.DataGridView
$dataGrid.Size = New-Object System.Drawing.Size(900, 230)
$dataGrid.Location = New-Object System.Drawing.Point(20, 480)
$dataGrid.AutoSizeColumnsMode = "Fill"
$dataGrid.ColumnCount = 2
$dataGrid.Columns[0].Name = "Header"
$dataGrid.Columns[1].Name = "Value"
$form.Controls.Add($dataGrid)

# List of important headers
$importantHeaders = @(
    "From", "To", "Reply-To", "Subject", "Date", "Message-ID", "Return-Path",
    "X-Mailer", "X-Originating-IP", "X-Forefront-Antispam-Report",
    "X-MS-Exchange-Organization-AuthAs", "X-MS-Exchange-Organization-Network-Message-Id",
    "X-MS-Exchange-Organization-MessageDirectionality", "X-MS-Exchange-Organization-SCL",
    "X-MS-Exchange-CrossTenant-AuthAs", "X-MS-Exchange-CrossTenant-AuthSource",
    "X-MS-Office365-Filtering-Correlation-Id", "Authentication-Results"
)

# Header analysis function
function Analyze-Headers {
    param($headerText)

    $dataGrid.Rows.Clear()
    $lines = $headerText -split "`r?`n"
    $allText = ($lines -join " ") -replace "\s+", " "

    if ($allText -match "Authentication-Results:.*?spf=(\w+).*?dkim=(\w+).*?dmarc=(\w+)") {
        $spf = $matches[1]
        $dkim = $matches[2]
        $dmarc = $matches[3]

        $dataGrid.Rows.Add("SPF", $spf)
        $dataGrid.Rows.Add("DKIM", $dkim)
        $dataGrid.Rows.Add("DMARC", $dmarc)
    }

    foreach ($line in $lines) {
        foreach ($header in $importantHeaders) {
            if ($line -match "^$header\s*:\s*(.+)$") {
                $value = $matches[1].Trim()
                $dataGrid.Rows.Add($header, $value)
            }
        }
        if ($line -like "Received:*") {
            $value = $line.Substring(9).Trim()
            $dataGrid.Rows.Add("Received", $value)
        }
    }

    foreach ($row in $dataGrid.Rows) {
        $label = $row.Cells[0].Value
        $val = $row.Cells[1].Value
        if ($label -in @("SPF", "DKIM", "DMARC")) {
            if ($val -match "(?i)pass") {
                $row.DefaultCellStyle.ForeColor = "Green"
            } elseif ($val -match "(?i)fail|none|neutral|softfail") {
                $row.DefaultCellStyle.ForeColor = "Red"
            }
        }
    }
}

# Load headers from file
$buttonUpload.Add_Click({
    $dialog = New-Object System.Windows.Forms.OpenFileDialog
    $dialog.Filter = "Email Files (*.eml;*.msg)|*.eml;*.msg"
    $dialog.Title = "Choose an Email File"

    if ($dialog.ShowDialog() -eq "OK") {
        try {
            $rawContent = Get-Content -Path $dialog.FileName -Raw
            $headers = $rawContent -split "(\r?\n){2}", 2 | Select-Object -First 1
            $richTextBox.Text = $headers
            Analyze-Headers $headers
        } catch {
            [System.Windows.Forms.MessageBox]::Show("Error loading file: $_", "Error", "OK", "Error")
        }
    }
})

# Analyze from input text
$buttonCheck.Add_Click({
    Analyze-Headers $richTextBox.Text
})

# Export to TXT
$buttonExportTxt.Add_Click({
    $sfd = New-Object System.Windows.Forms.SaveFileDialog
    $sfd.Filter = "Text File (*.txt)|*.txt"
    $sfd.Title = "Save as TXT"
    if ($sfd.ShowDialog() -eq "OK") {
        $output = ""
        foreach ($row in $dataGrid.Rows) {
            $output += "$($row.Cells[0].Value): $($row.Cells[1].Value)`r`n"
        }
        $output | Out-File -Encoding UTF8 $sfd.FileName
    }
})

# Export to CSV
$buttonExportCsv.Add_Click({
    $sfd = New-Object System.Windows.Forms.SaveFileDialog
    $sfd.Filter = "CSV File (*.csv)|*.csv"
    $sfd.Title = "Save as CSV"
    if ($sfd.ShowDialog() -eq "OK") {
        $rows = foreach ($row in $dataGrid.Rows) {
            "$($row.Cells[0].Value),`"$($row.Cells[1].Value)`""
        }
        $rows | Out-File -Encoding UTF8 $sfd.FileName
    }
})

$form.Add_Shown({ $form.Activate() })
[void]$form.ShowDialog()
